unsigned int enc(unsigned int y, unsigned int z)
{
  unsigned long long  c;
  
  c=0;
  while(y!=0){
    if(y&1) c ^=z;
    z<<=1; y>>=1;
  }
  return c;
  
}

//整数からベクトル型への変換
vec i2v(unsigned int n)
{
    vec v = {0};
    int i = 0;

    //if(n==0)
    //exit(1);

    while (n > 0)
    {
        v.x[i++] = n % 2;
        n = (n >> 1);
    }

    return v;
}

//ベクトル型から整数への変換
unsigned v2i(vec v)
{
    unsigned long long int d = 0, i;

    for (i = 0; i < 64; i++)
    {
        d ^= (v.x[i] << i);
    }
    
    return d;
}


// リーディグタームを抽出(default)
oterm vLT(vec f)
{
    int i;
    oterm t = {0};

    // k = deg (o2v (f));
    for (i = 0; i < DEG; i++)
    {
        // printf("a=%d %d\n",f.t[i].a,f.t[i].n);
        if (f.x[i] > 0)
        {
            t.n = i;
            t.a = f.x[i];
        }
    }

    return t;
}


// 多項式の次数(default)
int deg(vec a)
{
    int i, n = 0, flg = 0;

    // #pragma omp parallel for
    for (i = 0; i < DEG; i++)
    {
        if (a.x[i] != 0)
        {
            n = i;
            flg = 1;
        }
    }
    if (flg == 0)
        return 0;

    return n;
}

long long gcda(unsigned long long a, unsigned long long b)
{
    if(a==0) return b;
    if(b==0) return a;

    unsigned long long r;

    while(b != 0)
    {
        r = a % b;
        a = b;
        b = r;
        printf("b=%d\n",b);
    }

    if(a != 1){
        printf("(a,b) != 1\n");
        //exit(1);
        return a;
        //return a;
    }

    return 1;
}

