// aに何をかけたらbになるか
 long long 
equ( long long  a, long long  b)
{
    // for(unsigned long long  i=0;i<N;i++)
    if (b == 0)
        return 0;
    if (a == 1)
        return b;
    if(a==b)
    return 1;

    long long a_inv=inv(a,N);
    if(a_inv<0) return -1; //{ printf("no inv\n"); exit(1); }

    return (a_inv * b) % N;
}

//モニック多項式にする
vec coeff(vec f,  unsigned long long  d)
{
  int i, j, k;
  vec a, b;

  k = deg((f)) + 1;
  int dd=0;
  for (i = 0; i < k; i++){
    f.x[i] = (f.x[i]*inv(d,N)+N)%N;
  }
  return f;
}


oterm vLTdiv_safe(vec f, oterm t)
{
    oterm tt = vLT(f);
    oterm s = {0};

    if(tt.n < t.n) {
        s.n = 0;
        s.a = 0;
    } else {
        s.n = tt.n - t.n;
        long long c = equ(t.a, tt.a);
        if(c < 0) {
            long long k = inv(t.a, N);
            if(k < 0) {
                s.a = -1;  // 逆元なし
                return s;
            }
            c = (tt.a * k) % N;
        }
        s.a = c;
    }

    return s;
}

// 多項式を単行式で割る
oterm vLTdiv(vec f, oterm t)
{
    oterm tt = {0}, s = {
                        0};

    tt = vLT(f);
    if (tt.n < t.n)
    {
        s.n = 0;
        s.a = 0;
    }
    else if (tt.n == t.n)
    {
        s.n = 0;
        s.a = equ(t.a, tt.a);
    }
    else if (tt.n > t.n)
    {
        s.n = tt.n - t.n;
        s.a = equ(t.a, tt.a);
        // printf("%u\n",s.a);
    }
    else if (t.n == 0 && t.a > 0)
    {
        long long k=inv(t.a, N);
        if(k<0)
        s.a= -1;
        if(k>=0)
        s.a = (tt.a * k) % N;
        s.n = tt.n;
    }
    if(s.a<0){
        printf("%dx^%d\n",s.a,s.n);
        //exit(1);
    }

    return s;
}

