vec vmul(vec a, vec b,int R)
{
    int i, j, k, l;
    vec c = {0};

    k = deg(a);
    l = deg(b);

    if(l+k>N*2){
        printf("blake %d a=%d b=%d\n",l+k,deg(a),deg(b));
        //exit(1);
    }
    i = 0;
    while (i < k + 1)
    {
        for (j = 0; j < l + 1; j++)
        {
            if (a.x[i] > 0)
                c.x[i + j] = (c.x[i + j] + a.x[i] * b.x[j]) % R;
        }
        i++;
    }

    return c;
}


vec vdiv_safe(vec f, vec g)
{
    int i;
    vec tt = {0};  // 商
    vec h;
    oterm b, c;
    
    // tt の初期化
    for (i = 0; i < DEG; i++) tt.x[i] = 0;

    // g が 0 の場合はエラー
    if (vLT(g).a == 0) {
        printf("Error: division by zero g\n");
        exit(1);
    }

    // f の次数 < g の場合は商は 0
    if (deg(f) < deg(g)) {
        return tt;
    }

    b = vLT(g);  // g の先頭項

    // g が定数 1 の場合は f がそのまま商
    if (b.a == 1 && b.n == 0) {
        return f;
    }

    // 割り算ループ
    while (deg(f) >= deg(g)) {
        c = vLTdiv_safe(f, b);  // f の先頭項 ÷ g の先頭項

        // 安全性チェック
        if (c.n < 0 || c.n >= DEG || c.a <= 0 || c.a > N) {
            printf("Cannot reduce leading term: c.n=%d, c.a=%lld\n", c.n, c.a);
            exit(1);
        }
        if(c.a<0){
            printf("vad\n");
            exit(1);
        }
        if(c.n>DEG){
            printf("cnn\n");
            exit(1);
        }
        if(c.n>DEG)
        break;
        tt.x[c.n] = c.a;       // 商に格納
        h = vterml(g, c);      // c * g を作る
        f = vsub(f, h);        // f を更新

        // f が 0 になったら終了
        if (deg(f) < 0) break;
    }

    return tt;
}


